import React from 'react';
import { useParams } from "react-router-dom";
import { makeStyles, useTheme } from '@mui/styles';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import SearchBarV1 from '../components/SearchBarV1';

const useStyles = makeStyles(theme => ({
    container: {
        minHeight: 'calc(100vh - 56px)',
    }
}));

function SearchPage() {
    const theme = useTheme();
    const classes = useStyles();
    const { version } = useParams();
    const isOldVersion = version == 1;
    console.log('SearchPage', version, isOldVersion);

    return (
        <Grid container alignItems="flex-start" className={classes.container}>
            {isOldVersion && <SearchBarV1 />}
        </Grid>
    );
}

export default SearchPage;
